import React from 'react';

export default class Nutrients extends React.Component{
      render(){

            return(
                  <div className="nutrients">
                        <p>{this.props.label}</p>
                        <p>{this.props.total}mg</p>
                        <p><strong>{this.props.daily}</strong>%</p>  
                  </div>

            )
      }
}
